import React from 'react';
import {Box, Button} from "@material-ui/core"
import {Link} from 'react-router-dom';

class Coding extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div>
            <Grid
                container
                direction="row"
                justify="center"
                alignItems="center"
                >
                <Box component="span" m={1}>
                    <Button />
                    Yo
                </Box>
                </Grid>
            </div>

        );
    }
}

export default Coding;
